        public static string newsource(string str) {
            string itemBody = str;
            
            string[] partsOfBody = itemBody.Split(' ');
                foreach (string part in partsOfBody)
                {
               
                    if (part.Contains("src"))
                    {
                        string srcToBeReplaced = part;
                        
                        string[] partsOfSrc = part.Split('"');

                        string src = partsOfSrc[1];

                        string[] partsOfUrl = src.Split('/');
                    
                        string containerUrl = "https://stebrastorage.blob.core.windows.net/photos/";

                        string fileName = partsOfUrl[partsOfUrl.Length - 1];

                        string newSrc = partsOfSrc[0] + '"' + containerUrl + fileName + '"';


                        itemBody = itemBody.Replace(srcToBeReplaced, newSrc);
                }
               
                }

            return itemBody;
        }
        public static byte[] ImageToByte(Image img)
        {
            ImageConverter converter = new ImageConverter();
            return (byte[])converter.ConvertTo(img, typeof(byte[]));
        }
